                                     <h3>
                                          Einführung in Augmented Reality Spiele - Die Grundlagen
                                     </h3>
                                     <p>
                                          In der heutigen digitalen Welt eröffnen Technologien wie AR völlig neue Dimensionen des Spielens und Gestaltens. Unser Kurs richtet sich an alle, die sich für die
                                          Verschmelzung von virtueller und realer Welt interessieren und mit ihren eigenen Ideen die Welt bereichern möchten. Du musst kein Technik-Genie sein, um teilzunehmen. Dennoch
                                          wird es hilfreich sein, ein grundlegendes technisches Verständnis mitzubringen. Das Hauptziel dieses Kurses ist es, dir die Fähigkeiten und das Wissen zu vermitteln, um eigene
                                          AR-Spiele zu entwickeln. Wir führen dich Schritt für Schritt durch den gesamten Prozess. Angefangen bei den Grundlagen der Programmierung, über die Auswahl geeigneter Software
                                          und Hardware, bis hin zu Design-Elementen, die deine Spiele einzigartig machen. Am Ende des Kurses wirst du in der Lage sein, ein Spiel zu präsentieren, das nicht nur
                                          theoretisch, sondern auch praktisch funktioniert. Während des Kurses erhältst du einen tiefen Einblick in die faszinierende Welt der Augmented Reality. Du lernst, wie man
                                          virtuelle Objekte in Echtzeit in die reale Welt integriert. Dies geschieht durch den Einsatz moderner Entwicklungsplattformen wie Unity und ARKit. Egal, ob du schon Erfahrung
                                          in der Spieleentwicklung hast oder ein kompletter Neuling bist – unsere sorgfältig geplanten Module sind so gestaltet, dass jeder Teilnehmer maximal davon profitiert. Neben
                                          technischen Fähigkeiten legen wir großen Wert auf Kreativität und Design. Kreative Köpfe sind in diesem Kurs besonders gefordert! Du wirst lernen, wie man ansprechende und
                                          interaktive Spielwelten gestaltet, die den Spieler von Beginn an fesseln. Durch praxisnahe Projekte fördern wir deine Fähigkeit, innovative Spielkonzepte zu entwickeln und
                                          diese in ein spielbares Format zu bringen. Unsere erfahrenen Dozenten stehen dir mit Rat und Tat zur Seite und teilen wertvolle Tipps aus der Praxis. Ein weiterer wichtiger
                                          Bestandteil des Kurses ist die Vermittlung von Projektmanagement-Fähigkeiten. Du wirst lernen, wie man ein Projekt von der Idee bis zur Umsetzung strukturiert und organisiert.
                                          Dies umfasst die Planung der Entwicklungsphasen, die Gestaltung des User Interface und die abschließende Testing-Phase. Wir zeigen dir, wie du effizient arbeitest und dabei
                                          die Qualität deines Spiels sicherstellst. Nach Abschluss des Kurses wirst du nicht nur ein eigenes AR-Spiel entwickelt haben, sondern auch eine umfassende Kompetenz in der
                                          Nutzung von AR-Technologien erworben haben. Diese Fähigkeiten öffnen dir die Tür zu zahlreichen beruflichen Möglichkeiten, sei es in der Unterhaltungsindustrie, im
                                          Bildungssektor oder in der kreativen Medienbranche. Dein Portfolio wird deine neu erworbenen Fähigkeiten eindrucksvoll unter Beweis stellen. Wir freuen uns darauf, dich auf
                                          dieser spannenden Reise zu begleiten! Lass deiner Kreativität freien Lauf und tauche ein in die Welt der Augmented Reality Spiele. Gemeinsam schaffen wir Erlebnisse, die in
                                          Erinnerung bleiben. Starte noch heute und werde Teil einer zukunftsweisenden Technologiebewegung, die die Art und Weise, wie wir Spiele erleben, revolutioniert.
                                     </p><a href="#contact-form-section-0" class="button">Kontakt aufnehmen</a>
                                   </div>
