              <section class="price-pick-N" id="price-pick-N">
                <div class="photo" style="background: url('visual_library/UnAuJHWQgP.jpg') no-repeat; background-size: cover; background-position: center"></div>
                <div class="container">
                     <div class="price_holder">
                       <h2>
                            Erschwingliche Pläne für jeden Studenten
                       </h2>
                       <p class="price_section_description">
                            Entdecken Sie den passenden Tarifplan für Ihre berufliche Weiterentwicklung – mit der Flexibilität, genau dann zu lernen, wenn es Ihnen am besten passt, und der Unterstützung durch
                            unsere Experten, die Ihnen zum Erfolg verhelfen. Ganz gleich, ob Sie sich in einem neuen Bereich weiterbilden oder Ihre bestehenden Fähigkeiten vertiefen möchten, bieten wir Ihnen
                            maßgeschneiderte Lösungen, die auf Ihre individuellen Bedürfnisse abgestimmt sind. Lassen Sie uns gemeinsam die nächsten Schritte auf Ihrem Karriereweg gestalten.
                       </p>
                       <div class="price_cards">
                            <div class="price_card">
                              <h3>
                                   Kern
                              </h3>
                              <div class="price_amount">
                                   600 €
                              </div>
                              <p>
                                   Der Kernplan für einen Online-Kurs über Augmented Reality Games im deutschen Sprachraum konzentriert sich darauf, den Teilnehmern die technischen Grundlagen und kreativen Aspekte
                                   der Entwicklung von AR-Spielen zu vermitteln. Der Kurs beinhaltet praktische Übungen zur Nutzung von AR-Technologien und Tools sowie theoretische Einheiten zu Designprinzipien und
                                   Benutzererfahrungen. Ziel ist es, den Lernenden die Fähigkeiten zu vermitteln, eigene innovative AR-Spielkonzepte zu entwickeln und umzusetzen.
                              </p><a href="#contact-form-section-0" class="button">Kontaktieren</a>
                            </div>
                            <div class="price_card">
                              <h3>
                                   Professionell
                              </h3>
                              <div class="price_amount">
                                   700 €
                              </div>
                              <p>
                                   Der Professionell-Plan für einen Online-Kurs über Augmented Reality Spiele bietet umfassende Inhalte für fortgeschrittene Lernende, die ihre Fähigkeiten in der Entwicklung und
                                   Gestaltung von AR-Spielen vertiefen möchten. Teilnehmer profitieren von detaillierten Tutorials, praxisnahen Projekten und individuellem Feedback von erfahrenen Experten der
                                   Branche. Zusätzlich erhalten sie Zugang zu exklusiven Ressourcen und einer Gemeinschaft von Gleichgesinnten zum Austausch und Networking.
                              </p><a href="#contact-form-section-0" class="button">Kontaktieren</a>
                            </div>
                            <div class="price_card">
                              <h3>
                                   Basis
                              </h3>
                              <div class="price_amount">
                                   500 €
                              </div>
                              <p>
                                   Der Basisplan für einen Online-Kurs über Augmented Reality-Spiele bietet eine Einführung in die Grundlagen der AR-Technologie und deren Anwendung in der Spieleentwicklung.
                                   Teilnehmer lernen die wesentlichen Werkzeuge und Techniken kennen, um einfache AR-Spiele zu erstellen. Der Kurs richtet sich an Anfänger und setzt keine Vorkenntnisse in der
                                   Programmierung voraus.
                              </p><a href="#contact-form-section-0" class="button">Kontaktieren</a>
                            </div>
                       </div>
                     </div>
