              <section id="study-process-h" class="study-process-h">
                <div class="container">
                     <div class="holder">
                       <h2>
                            Unsere Kurse: Einblick und konkrete Erwartungen
                       </h2>
                       <p>
                            Lehrkräfte in Online-Kursen fungieren als Wegweiser und Mentoren, indem sie wertvolles Feedback und Unterstützung bieten, um den Studierenden zum akademischen Erfolg zu verhelfen.
                            Durch Online-Diskussionen, Live-Sitzungen und individuelles Feedback ermöglichen sie bedeutungsvolle Interaktionen und fördern ein Gemeinschaftsgefühl unter den Teilnehmenden. Darüber
                            hinaus passen sie ihre Lehrmethoden an die individuellen Bedürfnisse der Studierenden an und nutzen moderne Technologien, um den Lernprozess interaktiv und ansprechend zu gestalten.
                            Dies trägt dazu bei, die Motivation hochzuhalten und die Lernziele effizient zu erreichen. Gleichzeitig bieten Online-Lehrkräfte Unterstützung beim selbstständigen Lernen und helfen
                            den Studierenden, ihre Zeit effektiv zu managen und ihre akademischen Fähigkeiten kontinuierlich weiterzuentwickeln.
                       </p>
                     </div>
                </div>
              </section>

              <section id="who-we-are-L" class="who-we-are-L">
                <div class="holder">
                     <div class="container">
                       <div class="caption_holder">
                            <div class="photo" style="background: url('visual_library/tdIGFjS.jpg') no-repeat; background-size: cover; background-position: center"></div>
                            <div class="style_element">
                              <h2>
                                   Eduficaxis Hub
                              </h2>
                              <p>
                                   Eduficaxis Hub ist ein Unternehmen, das sich auf die Bereitstellung von Kursen im Bereich der Augmented Reality (AR) spezialisiert hat. Die Hauptphilosophie des Unternehmens dreht
                                   sich um die Vermittlung praktischer Fähigkeiten, die es den Lernenden ermöglichen, sich in der sich schnell entwickelnden Technologiebranche erfolgreich zu behaupten. Eduficaxis
                                   Hub legt großen Wert darauf, dass seine Teilnehmer nicht nur theoretisches Wissen erwerben, sondern auch in der Lage sind, dieses Wissen in realen Projekten anzuwenden. Dadurch
                                   wird eine Brücke zwischen akademischer Theorie und praktischer Anwendung geschlagen, die für den heutigen Arbeitsmarkt essentiell ist. Die Geschichte von Eduficaxis Hub begann vor
                                   einigen Jahren mit der Vision, Bildung im Bereich der erweiterten Realität zugänglicher und relevanter zu machen. Seit seiner Gründung hat sich das Unternehmen stetig
                                   weiterentwickelt und seine Kursangebote erweitert, um den Bedürfnissen der Lernenden und den Anforderungen der Industrie gerecht zu werden. Begonnen als kleines Start-up mit einer
                                   Handvoll Enthusiasten, hat sich Eduficaxis Hub zu einem anerkannten Namen in der Technologieausbildung entwickelt, der nun eine breite Palette von Kursen anbietet, die von
                                   Einsteigerkursen bis hin zu spezialisierten Workshops reichen. Ein entscheidender Faktor für den Erfolg von Eduficaxis Hub ist seine enge Zusammenarbeit mit der Industrie. Das
                                   Unternehmen hat Partnerschaften mit führenden Technologieunternehmen und innovativen Start-ups aufgebaut, um sicherzustellen, dass seine Kursinhalte stets aktuell und praxisnah
                                   sind. Diese Zusammenarbeit ermöglicht es den Studierenden, nicht nur von den Erfahrungen der Branchenprofis zu lernen, sondern auch wertvolle Einblicke in aktuelle und zukünftige
                                   Trends im Bereich der Augmented Reality zu gewinnen. Häufig werden Gastredner eingeladen, die über ihre Erfahrungen und Herausforderungen berichten, was den Lernenden ein besseres
                                   Verständnis für die reale Arbeitsumgebung vermittelt. Eduficaxis Hub bietet eine vielfältige Lernumgebung, die sowohl virtuelle als auch Präsenzoptionen umfasst. Diese
                                   Flexibilität ermöglicht es den Teilnehmern, ihr Lernen an ihre individuellen Bedürfnisse und Zeitpläne anzupassen. Die Kurse sind darauf ausgelegt, die Kreativität und
                                   Problemlösungsfähigkeiten der Teilnehmer zu fördern, indem sie sie ermutigen, gemeinsam an Projekten zu arbeiten und innovative Lösungen zu entwickeln. Diese projektbasierte
                                   Lernmethode hat sich als äußerst effektiv erwiesen, um die Lernenden optimal auf die Herausforderungen in der Praxis vorzubereiten. Das Unternehmen legt auch großen Wert darauf,
                                   die neuesten technologischen Entwicklungen in seine Kursangebote zu integrieren. Durch regelmäßige Updates der Lehrpläne und die Einführung neuer Technologien bleibt Eduficaxis
                                   Hub stets am Puls der Zeit. Dies bedeutet, dass die Teilnehmer immer mit den neuesten Tools und Techniken vertraut sind, die in der Industrie verwendet werden. Diese proaktive
                                   Herangehensweise stellt sicher, dass die Absolventen von Eduficaxis Hub bei der Jobsuche oder der Weiterentwicklung ihrer Karriere stets einen Schritt voraus sind. Zusammenfassend
                                   ist Eduficaxis Hub ein Pionier in der Ausbildung im Bereich der Augmented Reality. Mit seinem Fokus auf praktische Fähigkeiten, einer reichen Geschichte und starken
                                   Industriepartnerschaften bietet das Unternehmen seinen Teilnehmern eine umfassende und zukunftsorientierte Bildungserfahrung. Die Kombination aus praxisnahem Lernen, aktueller
                                   Technologie und realen Einblicken in die Industrie macht Eduficaxis Hub zu einer ausgezeichneten Wahl für alle, die ihre Fähigkeiten im Bereich der erweiterten Realität vertiefen
                                   und eine Karriere in einer der aufregendsten und dynamischsten Branchen der heutigen Zeit anstreben.
